MAIS ALGUMAS AÇÕES DO GOVERNO DO BRASIL ENTRE OS DIAS 15 E 19 DE JUNHO: 

- Mais informações sobre divulgações diárias do trabalho do @govbr , acompanhe as redes sociais.

