Divulgações diárias nas redes sociais (final de maio / início de junho)

A. Deflagrada 2a fase de investigações de desvios nos estados;

B. 108 milhões de pagamentos da 1a e 2a parcelas do auxílio de R$600 realizados. 58,6 milhões de brasileiros alcançados; @MinCidadania

