1. Internet ( interligando 16.000 unidades básicas de saúde de todo país, também as de localidades mais isoladas);

2. Testes em andamento de medicamento no combate ao covid-19 e outras epidemias; https://t.co/gckMhtHxXx

MAIS AÇÕES DO @govbr
(1º/5 A 7/5):

1- ATO DE 2019, ABRE TODAS AS MOVIMENTAÇÕES PÚBLICAS FINANCEIRAS. LOGO, O GOVERNO FEDERAL DETERMINOU À CONTROLADORIA GERAL DA UNIÃO QUE AJA NA FISCALIZAÇÃO DE TODOS OS GASTOS, INCLUSIVE NESTE MOMENTO DE COVID-19. FATO EM PROCESSO EVOLUTIVO;

. Mais ações do @govbr entre 24/4 a 27/04/20:

1- Início das entregas de soluções NACIONAIS para respiradores;

2- R$ 163 milhões da saúde para habilitação de 1.134 leitos de UTI pelo Brasil;

3- Maior produção de etanol da história: 35,6 bilhões de litros na safra 2019/20;

- Auxílio emergencial (19/04/2020):

. 18 milhões de brasileiros já foram beneficiados;

. R$ 12,2 bilhões pagos até então;

. Mais de 10 milhões de Contas Popança Social Digital abertas sem custo.

. Governo Federal avançando a cada dia e vamos avançar mais!

